    <div>

    <table className="table table-striped">
    <thead>
            <tr>
              <th> ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Gender</th>
              <th>Status</th> 
            </tr>
        </thead>

          <tbody>

        {(persons).map((person) => {
          return(
                <tr key={person.id}>
                <td>{person.id}</td>
                <td>{person.name}</td>
                <td>{person.email}</td>
                <td>{person.gender}</td>
                <td>{person.status}</td>
                </tr>)
              })}
          </tbody>
      </table>

      </div>
  );

}

export default App;
